contracts/FlightOracle.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract FlightOracle is ChainlinkClient, Ownable {
    using Chainlink for Chainlink.Request;

    address private oracle;
    bytes32 private jobId;
    uint256 private fee;

    mapping(bytes32 => uint256) public flightDelays; // Store flight delays

    event FlightDataRequested(bytes32 indexed requestId, string flight, uint256 delayMinutes);
    event FlightDataUpdated(bytes32 indexed requestId, uint256 delayMinutes);

    constructor() Ownable(msg.sender) {
        setChainlinkToken(0x326C977E6efc84E512bB9C30f76E30c160eD06FB); // Amoy LINK token
        oracle = 0xCC79157eb46F5624204f47AB42b3906cAA40eaB7; // Chainlink Oracle (Amoy)
        jobId = "ca98366cc7314957b8c012c72f05aeeb"; // Chainlink HTTP GET Job ID
        fee = (1 * LINK_DIVISIBILITY) / 10; // 0.1 LINK
    }

    function requestFlightStatus(string memory flightNumber, string memory departureDate) public onlyOwner returns (bytes32 requestId) {
        Chainlink.Request memory req = buildChainlinkRequest(jobId, address(this), this.fulfill.selector);

        string memory apiUrl = string(abi.encodePacked(
            "https://your-flask-api.com/api/flight-delay?flight_iata=", 
            flightNumber, "&departure_date=", departureDate
        ));

        req.add("get", apiUrl);
        req.add("path", "delay_minutes"); // Extract delay value

        requestId = sendChainlinkRequestTo(oracle, req, fee);
        emit FlightDataRequested(requestId, flightNumber, 0);
    }

    function fulfill(bytes32 _requestId, uint256 _delay) public recordChainlinkFulfillment(_requestId) {
        flightDelays[_requestId] = _delay;
        emit FlightDataUpdated(_requestId, _delay);
    }
}

contracts/InsurancePolicy.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@chainlink/contracts/src/v0.8/ChainlinkClient.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract InsurancePolicy is ChainlinkClient, Ownable {
    using Chainlink for Chainlink.Request;

    struct Policy {
        address user;
        string flightNumber;
        uint256 departureDate;
        uint256 premium;
        string currency;
        bool claimed;
    }

    mapping(bytes32 => Policy) public policies;
    mapping(address => bytes32[]) public userPolicies;
    mapping(bytes32 => bytes32) public requestToPolicy;  // Map Chainlink request to policy

    address public oracle;
    bytes32 public jobId;
    uint256 public fee;

    event PolicyPurchased(address indexed user, bytes32 policyId, string flightNumber);
    event PayoutProcessed(address indexed user, uint256 amount, string currency);
    event FlightStatusRequested(bytes32 indexed requestId, string flightNumber, uint256 departureDate);

    constructor(
        address _oracle,
        bytes32 _jobId,
        uint256 _fee
    ) Ownable(msg.sender) {
        setChainlinkToken(0x326C977E6efc84E512bB9C30f76E30c160eD06FB); // Polygon Amoy LINK token
        oracle = _oracle;
        jobId = _jobId;
        fee = _fee;
    }

    function buyInsurance(
        string memory _flightNumber,
        uint256 _departureDate,
        uint256 _premium,
        string memory _currency
    ) external payable {
        require(msg.value == _premium, "Incorrect premium amount");

        bytes32 policyId = keccak256(abi.encodePacked(msg.sender, _flightNumber, _departureDate));
        policies[policyId] = Policy(msg.sender, _flightNumber, _departureDate, _premium, _currency, false);
        userPolicies[msg.sender].push(policyId);

        emit PolicyPurchased(msg.sender, policyId, _flightNumber);
    }

    function requestFlightStatus(string memory _flightNumber, uint256 _departureDate) public onlyOwner {
        Chainlink.Request memory request = buildChainlinkRequest(jobId, address(this), this.fulfill.selector);
        request.add("flight", _flightNumber);
        request.addUint("departureDate", _departureDate);

        bytes32 requestId = sendChainlinkRequestTo(oracle, request, fee);
        bytes32 policyId = keccak256(abi.encodePacked(msg.sender, _flightNumber, _departureDate));

        requestToPolicy[requestId] = policyId;
        emit FlightStatusRequested(requestId, _flightNumber, _departureDate);
    }

    function fulfill(bytes32 _requestId, uint256 _delayMinutes) public recordChainlinkFulfillment(_requestId) {
        bytes32 policyId = requestToPolicy[_requestId];  
        Policy storage policy = policies[policyId];

        require(!policy.claimed, "Already claimed");

        if (_delayMinutes >= 120) { // If delay is 2 hours or more, process payout
            policy.claimed = true;
            payable(policy.user).transfer(policy.premium);

            emit PayoutProcessed(policy.user, policy.premium, policy.currency);
        }
    }

    function withdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

